    function getAverageRGB(imgEl) {
        if (!imgEl) return null;
        // console.log(imgEl)
        var blockSize = 1, // only visit every 5 pixels
            defaultRGB = { r: 128, g: 128, b: 128 }, // for non-supporting envs
            canvas = document.createElement('canvas'),
            context = canvas.getContext && canvas.getContext('2d'),
            data, width, height,
            i = -4,
            length,
            rgb = { r: 0, g: 0, b: 0 },
            count = 0;

        if (!context) {
            return defaultRGB;
        }
        height = canvas.height = imgEl.naturalHeight || imgEl.offsetHeight || imgEl.height;
        width = canvas.width = imgEl.naturalWidth || imgEl.offsetWidth || imgEl.width;

        context.drawImage(imgEl, 0, 0);

        try {
            data = context.getImageData(0, 0, width, height);
            // console.log(data);
        } catch (e) {
            /* security error, img on diff domain */
            // alert('x');
            // console.log('error');
            $scope.isColorError = true;
            return defaultRGB;
        }

        length = data.data.length;

        while ((i += blockSize * 4) < length) {
            ++count;
            rgb.r += data.data[i];
            rgb.g += data.data[i + 1];
            rgb.b += data.data[i + 2];
        }

        // ~~ used to floor values
        rgb.r = ~~(rgb.r / count);
        rgb.g = ~~(rgb.g / count);
        rgb.b = ~~(rgb.b / count);

        return rgb;

    }


    function containsObject(obj, list) {
        // console.log(list);
        // console.log(obj);

        if (obj.domain.split("")[0] != 'w' && obj.domain.split(".")[1] == 'google')
            return false;
        for (var x in list) {
            if (list[x].domain == obj.domain || list[x].name == obj.name || list[x].domainName == obj.name) {
                return list[x];
            }
        }
        return false;
    }

    function makeName(metro) {
        var urlArry = metro.domain.split(".");
        if (urlArry[0] == 'www') return urlArry[1];
        else if (urlArry[1] == 'com' ||
            urlArry[1] == 'net' ||
            urlArry[1] == 'org' ||
            urlArry[1] == 'edu' ||
            urlArry[1] == 'gov' ||
            urlArry[1] == 'info' ||
            urlArry[1] == 'io' ||
            urlArry[1] == 'mail' ||
            urlArry[1] == 'cc' ||
            urlArry[1] == 'me'
        ) return urlArry[0];
        else if (urlArry[2] == 'com' ||
            urlArry[2] == 'net' ||
            urlArry[2] == 'org' ||
            urlArry[2] == 'edu' ||
            urlArry[2] == 'gov' ||
            urlArry[2] == 'info' ||
            urlArry[2] == 'io' ||
            urlArry[2] == 'mail' ||
            urlArry[2] == 'cc' ||
            urlArry[2] == 'me'
        ) return urlArry[1];
        else if (urlArry[3] == 'com' ||
            urlArry[3] == 'net' ||
            urlArry[3] == 'org' ||
            urlArry[3] == 'edu' ||
            urlArry[3] == 'gov' ||
            urlArry[3] == 'info' ||
            urlArry[3] == 'io' ||
            urlArry[3] == 'mail' ||
            urlArry[3] == 'cc' ||
            urlArry[2] == 'me'
        ) return urlArry[2];
        else {
            if (metro.domain.split(":")[0] == "127.0.0.1")
                return "127.0.0.1";
            else if (metro.domain.split(":")[0] == "localhost")
                return "localhost";
            else
                return urlArry[1];
        }
    }


